import React from 'react';

/*
    Legg til onClick på pil tilbake for å gå til forrige side
    Legg til onClick på øl for å komme til hjemsiden
    Legg til onHove
*/

export class Header extends React.Component {


    render() {
        return(
            <div className='fixed top-0 bg-violet-600 w-screen h-20 flex items-center justify-center'>
                <div className='inline-flex pb-4 content-center'>
                    <p className="pt-4 pr-28 text-1xl" >⬅️</p>
                    <p className='font-thin text-bold text-base content-center pt-5  text-white'>Dashboard</p>
                    <p className='pt-3 pl-28 text-3xl'>🍻</p>
                </div>
            </div>
        );
    }
}
